import React from 'react';
import styled, {css} from 'styled-components';
import { Footer, GetInTouch } from '../../molecules';
import {Flex} from '../../atoms';
import {media} from '../../../mixins';

const {desctopLG} = media;

const Container = styled(Flex)`
  ${({theme: {sizing}}) => css`
    max-width: ${sizing.mainContainer};
    ${desctopLG}{
      margin-left: auto;
      margin-right: auto;
    }
  `}
`;

const StyledBlock = styled.div`
  ${({theme: {color}}) => css`
    background: ${color.gradient};  
  `}
`;

const GetInTouchOrganism = ({handleRedirectToPage}) => {
  return(
    <StyledBlock>
      <GetInTouch handleRedirectToPage={handleRedirectToPage}/>
      <Container paddingX='xl11'>
        <Footer/>
      </Container>
    </StyledBlock>   
  )
};

export default GetInTouchOrganism;
